    [],nt"revision_timestamp": "2016-07-27T22:56:16.090647",nt"name": "lake-ilo-national-wildlife-refuge-annual-narrative-report-calendar-year-1989",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Lake Ilo
    National Wildlife Refuge outlines Refuge accomplishments during the 1989 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    Refuge administration is outlined; information about personnel, youth programs,
    volunteer programs, funding, and safety is given. Habitat management is also covered;
    subjects include wetlands, forests, croplands, grasslands, other habitats, grazing,
    haying, fire management, and pest control. The wildlife section of the report discusses
    endangered and threatened species, waterfowl, marsh and water birds, shorebirds,
    raptors, other migratory birds, game mammals, other resident wildlife, fisheries
    resources, wildlife propagation and stocking, animal control, marking and banding,
    and disease prevention and control. The public uses of the Refuge described in this
    report include hunting, fishing, trapping, picnicking, and law enforcement. The
    equipment and facilities section of the report provides information about new construction,
    rehabilitation, major maintenance, equipment replacement, and communication systems.
    Cooperative programs are provided at the end. Photographs are attached. Brief narratives
    on White Lake, Stewart Lake, and Pretty Rock National Wildlife Refuges are included.",nt"license_title":
